export default function SignIn() {
 
  const divStyle = {
    margin: '30px 0',
    padding:'15px',
    border:'1px solid #ccc'
};


  return (
    <div style={divStyle}>
      <form>
        <la>Login</la>
        <br></br>
        <label>
          E-mail:
          <input type="text" name="Email"/>
        </label>
        <label>
          Senha:
          <input type="password" name="Email"/>
        </label>
      </form>
    </div>
  );
}
